ISLAMABAD, Jan 7 (APP): President Dr. Arif Alvi on Friday appointed Muhammad Saeedullah Yusufzai as Member of Pakistan Agricultural Research Council (PARC) Board of Governors (BOG).
The President made the appointed under Section 10 of Pakistan Agricultural Research Council Ordinance 1981.
